import React, {Component} from "react";
import Item from "../Item/Item"

export default function ItemList({items}) {
    const itemElements = items.map(item =>
        <li><Item item = {item}/></li>);
    return(
        <ul>
            <li><Item item={items[0]}/></li>
        </ul>
    )
}
